import React from "react";
import '../scss/main.scss';

const SectionImage = () => {


    return (
        <section className='Home'>
            <img src={require("../images/Patrycja_1.jpg")} style={
                {
                    width: '800px',
                    height: '800px',
                    display: "flex",
                    justifyContent:"center"
                }
            }/>
        </section>
    )
}

export default SectionImage
